const getId = (e) => e.id || e._id;

async function createDemoPets(userId) {
    const pets = await Promise.all(demoPets.map((pet) => {
        console.log('Created Pet', pet.name);

        return petService.createPet({
            name: pet.name,
            description: pet.description,
            type: pet.type,
            age: pet.age,
            gender: pet.gender,
            profilePhoto: pet.profilePhoto,
            tags: pet.tags,
            addedBy: userId
        });
    }));
    const firstPetId = getId(pets[0]);
    const secondPetId = getId(pets[1]);
    await userService.savePet({ userId, petId: firstPetId });
    await userService.savePet({ userId, petId: secondPetId });
}

async function createDemoUser() {
    const user = await userService.createUser({
        email: 'test@example.com',
        name: 'עמותת SOS',
        password: '12345'
    });
    const userId = getId(user);
    await createDemoPets(userId);

    return user;
}

mongoose.connection.on('connected', async (err) => {
    const user = await createDemoUser();
    console.log('Created User', user.name, getId(user));
    process.exit(0);
});
